import React, { Component, Fragment } from 'react';
import Button from '@material-ui/core/Button';
import MyGoogleMap from "./MyGoogleMap";
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import 'whatwg-fetch';

class HomePage extends Component{
    state={
        url: "https://pic1.zhimg.com/80/v2-40b17763b4eb99ed91c3be971516cc98_hd.jpg",
        error: ""
    }

    handleChange = event =>{
        this.setState({url: event.target.value})
    }

    componentDidUpdate(){

    }

    callBackend = () =>{
        const {url} = this.state;
        console.log(`try calling api using url ${url}`);
        window
        .fetch("https://vision-backend-codejam.herokuapp.com/image", {url})
        .then(res => res.json())
        .then(
            (result) => {
            this.setState({
                result
              });
              console.log(result);
            },
            // Note: it's important to handle errors here
            // instead of a catch() block so that we don't swallow
            // exceptions from actual bugs in components.
            (error) => {
              this.setState({error: "call failed"});
            }
         )
         .catch(
             error => 
              console.log(`catch error ${error}`)
            );
    }

    render(){
        return  (
        <Fragment>
        <AppBar position="static" color="inherit">
               <Toolbar>
                    <Typography variant="h6" color="secondary">
                        Photos
                    </Typography>
                </Toolbar>
        </AppBar>
        <Grid container spacing={24} style={{ margin: '100px'}}>
            <Grid item xs={3}>
                <Paper>
                <form noValidate autoComplete="off">
                    <TextField
                        id="standard-name"
                        label="Enter picture URL:"
                        value={this.state.url}
                        onChange={this.handleChange}
                        margin="normal"
                    />
                </form>
                <Button variant="contained" color="primary" onClick={this.callBackend}>
                    Submit
                </Button>
                </Paper>
            </Grid>
            <Grid item xs={9}>
                <MyGoogleMap url={this.state.url}/>
            </Grid>
        </Grid>
        </Fragment>);
    }
}

export default HomePage;
